import React from "react";

function NoteList({ notes, deleteNote, selectNote }) {
  console.log("Notes:", notes); // Log notes to check if they are received correctly

  return (
    <div>
      <h2>Notes</h2>
      <ul>
        {notes.map((note) => (
          <li key={note.title}>
            <h3>{note.title}</h3>
            <p>{note.content}</p>
            <small>Tags: {note.tags.join(", ")}</small>
            <br />
            <button onClick={() => selectNote(note)}>Edit</button>
            <button onClick={() => deleteNote(note.title)}>Delete</button>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default NoteList;
